import React from 'react'
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div>
            <center>
            <h1 style={headerStyle}>Todos</h1>
            <Link to="/about">About</Link>
            </center>
        </div>
    )
}

const headerStyle = {
    backgroundColor:'black',
    width:'100vw',
    color:'white',
    padding:'20px',
    margin:0
}
export default Header;
